mit Tandon ","artist_slug":"/artist/amit-tandon-40","video_title":"College Stories by Comics | Chaar Yaar - Ep2 @PrashastiSinghStandup @agstandup @GursimranKhamba","video_description":"In this episode, Abijit Ganguly, Gursimran khamba and Prashasti Singh join Amit Tandon to share their College experiences and stories. They had some common threads like Delhi University, IIT Delhi and also very different career goals that all finally ended with Comedy.\nPrashasti talks about how giving more freedom to Girls in college will prepare them better for life. The constant fear inculcated among students in the garb of discipline stops them from expressing themselves and a small change in approach can make a big difference\n\nPresenting to you Chaar Yaar! Is it a podcast? Maybe not. Is it scripted? Probably not. Are we sharing secrets of life? Definitely not! I just wanted to find a reason to hang out with some of my comedian friends I have made over the years and Chaar Yaar is a product of just that. \n\n\nIntro: 1:31 -  6:05\nRevisiting College Days: 6:06 - 23:34\nIs it strange to see your college friends mature and changing?: 23:35 - 27:56\nWhat's the closest you've come to being rusticated in college? 27:57 - 35:20\nWhat was your dream career when you entered college? 35:26 - 44:10\nWhat all will you like to change in your college? 44:18 - 57:16\nOutro, Closing and Credits: 57:17 - 59:11\n\nProduced by Sonalive Entertainment Pvt Ltd\nProduction House: Knock Knock Productions (https://www.instagram.com/knockknock.prod)\nDirector/E.P - Arbaaz Nasser (https://www.instagram.com/arbaaznasser)\nCreative Director - Rohit Shah (https://www.instagram.com/rohshah)\nProduction Designer - Pooja Singh (https://www.instagram.com/spooja2910)\nD.O.P - Sakshat Shetty & Arbaaz Nasser\n1st AC - Aaditi Hirani (https://www.instagram.com/aaditihirani)\n2nd AC - Kedar Jadhav (https://www.instagram.com/kedar.acharkear.1)\nLine Producer - Alina Rajan (https://www.instagram.com/alinarajan_)\nA.D. -