"}],"video_small_img":"https://i.ytimg.com/vi/h1_ttRtc-bg/default.jpg","video_medium_img":"https://i.ytimg.com/vi/h1_ttRtc-bg/mqdefault.jpg","video_large_img":"https://i.ytimg.com/vi/h1_ttRtc-bg/hqdefault.jpg","video_standard_img":"https://i.ytimg.com/vi/h1_ttRtc-bg/sddefault.jpg","video_maxres_img":"https://i.ytimg.com/vi/h1_ttRtc-bg/maxresdefault.jpg","video_slug":"/video/manifesting-sonam-bajwa-stand-up-comedy-ft-abhishek-walia-audience-interaction-24224","video_publish_date":"2024-10-16T10:15:02Z","video_lyrics":null,"original_credits":null,"video_duration":"00:20:14","video_definition":"hd","video_caption":"false","status":"ACTIVE","created_by_uuid":null,"created_by_name":null,"modified_by_uuid":null,"modified_by_name":null,"create_ts":"2024-10-18T18:06:26.000Z"},{"videos_final_data_id":24237,"videos_final_data_uuid":"977016d0-8d4d-11ef-a4e2-d270ca4b126d","artist_id":6,"artist_name":"Sundeep Sharma","artist_slug":"/artist/sundeep-sharma-6","video_title":"Sundeep Sharma Stand-up Comedy -College Fest","video_description":"I perform at College festivals quite regularly and connect with the young and brilliant minds that will shape up the future of our beloved nation; India/Bharat. As a rule, I reach colleges/universities much before my performance time and like to learn and research about what is going on in those bright and Khurafati minds. I also do it for the selfish reason that it takes me back to my own college days when I was one of the most khurafati young men but also, one of the top debaters in the country. I eat at the college canteens and like to attend their after parties if I am invited, P.S: I am always invited :D This bit is part fact, part fiction, but it definitely covers some hilarious incidents that happened along the journey of me doing college festival shows across the country, if you like this one and share it extesively and comment on this one, I shall make this a series and will come up with more in this series, for that, you will have to c